//the reason why we make this as a functional component 
//is because we need to make sign-up and sign-in respectively

const SignInAndSignUpPage = () => {

  return(
    <div className="sign-in-and-sign-up"> 
      <SignIn />
      <SignUp />
    </div>
  )
}


